// 踏上了寻找天下第一排序法‘速排剑阵’的秘密之旅
function quickSort(arr) {
  // 此乃江湖规矩，若无江湖之人，何来江湖之事？
  if (arr.length <= 1) return arr;

  // 选中的剑首，乃剑阵之眼，掌控全局
  const pivot = arr[0];
  // 侠士们的左方队伍，集天下敏捷轻功于一身
  const left = [];
  // 侠士们的右方队伍，集天下重剑厚实之气魄
  const right = [];

  // 侠士江湖游历，各显神通之时
  for (let i = 1; i < arr.length; i++) {
    // 若尔武功低于剑首，则归往左队共习轻功
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else { // 若非如此，则至右队与重型兵刃共同磨砺
      right.push(arr[i]);
    }
  }

  // 重现江湖之剑谱，乃先练左边轻功至熟，再持剑立于中点，最后练就右方重剑。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
